import React, { Component } from 'react'
import CheckingButBox from './ChildCheckB'

class ParentBut extends Component {
    constructor(props) {
        super(props)

        this.state = {
            noDisable: true   
        }
    }

    render () {
        return (
            <div>
                <h1>Cocher le checkbox pour voir Bouton:</h1>
                <button disabled={this.state.noDisable}>Bouton Ok si CB Ok</button>
                <CheckingButBox />
            </div>
        )
    }
}
export default ParentBut;
